import './App.css';
import { Route, Switch, Redirect } from 'react-router-dom';

import Nav from './components/Nav';
import Home from './pages/Home'
import Cutest from './pages/Cutest';
import Gallery from './pages/Gallery';



function App() {
  return (

    <div className="app">
      <Nav />
      <Switch>
        <Route path="/">
          <Home /> 
        </Route>

        <Route path="/cutest">
          <Cutest /> 
        </Route>

        <Route path="/gallery">
          <Gallery />
        </Route>
        <Route path="/hamsters">
          <Redirect to="/gallery"/>
        </Route>
      </Switch> 
    </div>
  );
}

export default App;
